import React from 'react'

import {Link} from  'react-router-dom'
import ig from '../download.png'
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import SearchIcon from '@mui/icons-material/Search';

const Navbar = () => {
    return (
      <div>
       <div className="m-0">
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container-fluid">
            <a href="#" className="navbar-brand">Brand</a>
            <button type="button" className="navbar-toggler" data-bs-toggle="collapse" data-bs-target="#navbarCollapse">
                <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse justify-content-between" id="navbarCollapse">
                <div className="navbar-nav">
                    <Link to='/' className="nav-item nav-link active">Home</Link>
                    <Link to='/login' className="nav-item nav-link">Login</Link>
                    <Link to='/signup' className="nav-item nav-link">SignUp</Link>
                    <Link to='/cart' className="nav-item nav-link">Cart</Link>


                    
                </div>
                <form className="d-flex">
                    <div className="input-group">
                        <input type="text" className="form-control" placeholder="Search"/>
                        <button type="button" className="btn btn-secondary"> <SearchIcon style={{"backgroundColor":"yellow"}}/></button>
                    </div>
                </form>
                <div className="navbar-nav">
                    <a href="#" className="nav-item nav-link">Login</a>
                </div>
            </div>
        </div>
    </nav>
</div>
      </div>
















